import React, {useEffect, useState} from 'react'
import { Button, Table } from 'react-bootstrap'
import axios from 'axios'

const Tenantdata = () => {
    const [users, setUsers] = useState([])
    useEffect(() => {
        axios.get("http://localhost:8000/tenantdata")
        .then((response) => {
            console.log("response-----",response.data)
            setUsers(response.data)
        })
        .catch((error) => console.log(error))
    })
  return (
    <>
        <div className='container'>
            <h1>Tenants Data</h1>
            <Table striped>
                <thead >
                    <tr>
                        <th>Id</th>
                        <th>Tenants</th>
                        <th>Type</th>
                        <th>User Id</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                {users.map((user) => {
                    return(
                        <tr>
                            <td>{user.id}</td>
                            <td>{user.tenant}</td>
                            <td>{user.type}</td>
                            <td>{user.userid}</td>
                            <td><Button>button1</Button><Button>button2</Button><Button>button3</Button></td>
                        </tr>
                    )
                })}
                <tbody>

                </tbody>
            </Table>
        </div>
    </>
  )
}

export default Tenantdata
